import React from "react"
import {NavLink,Link,Outlet, useNavigate} from "react-router-dom"



const About=(p)=>{
             
        const n=useNavigate()
        const goto=()=>{
              n("/contact")
         }     

    return (
      <>
         <h1>About {p.name}</h1>
         <NavLink style={{color:"red"}} to="/"> About Us</NavLink><br/>
         <NavLink to="contact"> contact</NavLink><br/>
         
         <NavLink to="Name"> Name</NavLink><br/>
         <Link style={{color:"red"}} to="/"> About Us</Link><br/>

         <button onClick={()=>{ goto()}} style={{margin:"20px"}}>navigate</button>
         <a href="/" >About us</a>
         <a href="/contact" >contact</a>
        
         <Outlet/>
      </>
    )
}

export default About
